import React from "react";
import colors from "tailwindcss/colors";

const Footer = () => {
  return (
    <div className="p-4" style={{ "background": "#F6F6F6" }}>



      <div>

        <div className="space-y-4 border-b sm:border-b-0 sm:w-max sm:pr-4 sm:border-r border-gray-300 pb-5">
          <h3 className="text-sm font-medium text-center sm:text-left" style={{ "color": "#333333" }}>JOIN OUR MAILING LIST</h3>

          <div className="flex justify-center sm:justify-start">
            <input className="outline-none px-4 py-1.5 border border-gray-500" style={{ "color": "#0E3860","border-radius":"4px" }} placeholder="Name" />
          </div>
          <div className="flex justify-center sm:justify-start">
            <input className="outline-none px-4 py-1.5 border border-gray-500" style={{ "color": "#0E3860","border-radius":"4px" }} placeholder="Password" type={"password"} />
          </div>
        </div>


        <div className="py-4">

             <div>
                <h1 className="text-sm font-medium" style={{ "color": "#333333" }}>OUR LOCATIONS</h1>

                <h3 className="" style={{ "color": "#333333" }}>Toronto</h3>

             </div>

        </div>


      </div>






    </div>
  );
};

export default Footer;
